import React from 'react'
import './Person.css'
const Preson = (arg)=> {
return (<div className="Person_css">
        <p onClick={arg.click} >Name : {arg.name} Id :{arg.Id} summary : {arg.summary}</p>
    </div>)
};

export default Preson;
